#collector-content pre.sf-dump,
#collector-content .sf-dump code,
#collector-content .sf-dump samp {
    font-family: monospace;
    font-size: 13px;
    font-size-adjust: 0.5;
}

#collector-content pre.sf-dump {
    background: #222;
    line-height: 1.4;
    margin-top: .5em;
    padding: 1em;
}

#collector-content .sf-dump h3 {
    font-size: 18px;
    margin: .5em 0 0;
}

#collector-content .sf-dump h3 a {
    cursor: pointer;
}

#collector-content pre.sf-dump {
    color: #CC7832;
}

#collector-content .sf-dump-str {
    color: #629755;
}

#collector-content .sf-dump-private,
#collector-content .sf-dump-protected,
#collector-content .sf-dump-public {
    color: #E0E0E0;
}

#collector-content .sf-dump-note {
    color: #6897BB;
}

#collector-content .sf-dump-key {
    color: #A5C261;
}

#collector-content .sf-dump .trace {
    border: 1px solid #DDD;
    background: #FFF;
    padding: 10px;
    margin: 1em 0;
}

#collector-content .sf-dump .trace {
    font-size: 12px;
}

#collector-content .sf-dump .trace code {
    font-size: 14px;
}

#collector-content .sf-dump .trace li {
    margin-bottom: 0;
    padding: 5px 0;
}

#collector-content .sf-dump .trace li.selected {
    background: rgba(255, 255, 153, 0.5);
}

#search-results td {
    font-family: Helvetica, Arial, sans-serif;
    vertical-align: middle;
}

#search-results .sf-search {
    visibility: hidden;
    margin-left: 2px;
}

#search-results tr:hover .sf-search {
    visibility: visible;
}

.visible-small {
    display: none;
}

.hidden-small {
    display: inherit;
}

@media (max-width: 768px) {
    #collector-content {
        margin-left: 50px;
    }

    #sidebar {
        width: 50px;
        overflow-y: hidden;
        transition: width 200ms ease-out;
    }

    #sidebar:hover, #sidebar.expanded {
        width: 220px;
    }

    #sidebar-search {
        display: none;
    }

    #sidebar:hover #sidebar-search.sf-toggle-visible, #sidebar.expanded #sidebar-search.sf-toggle-visible {
        display: block;
    }

    #sidebar .module {
        display: none;
    }

    #sidebar:hover .module, #sidebar.expanded .module {
        display: block;
    }

    .visible-small {
        display: inherit;
    }

    .hidden-small {
        display: none;
    }

    .btn-sm svg {
        margin-left: 2px;
    }
}

